            ((DateTime)parameter.Value).Should().Be(expectedDate);
            result.Value.where.Should().Contain($"CONVERT(DATE,[{DBPreClientesDicInfo.PTabelaNome}].[{DBPreClientesDicInfo.DtNasc}], 103) = CONVERT(DATE, @{DBPreClientesDicInfo.DtNasc}, 103)");
        }

